import './home.css';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import tile1 from '../../images/IMG-3163.jpg';

export default function AboutUsLinks() {

   return (
    <div className="aboutContainer">
        <div className="circleBtn1">
        <Link to="/store">  
          <img className="circleimg" src={tile1} alt="First slide"/>
        </Link>
        </div>
        <div className="circleBtn2">
        <Link to="/store" className="linkBtn2">  
          <img className="circleimg" src={tile1} alt="First slide"/>
        </Link>
        </div>
        <div className="circleBtn3">
        <Link to="/store" className="linkBtn3">  
          <img className="circleimg" src={tile1} alt="First slide"/>
        </Link>
        </div>
    </div>
  );
}
